CASE WHEN (model_input."X_3" <= 2.500000) THEN CASE WHEN (model_input."X_5" <= 1.500000) THEN 63 ELSE CASE WHEN (model_input."X_6" <= 6.500000) THEN 113 ELSE 114 END END ELSE CASE WHEN (model_input."X_4" <= 1.500000) THEN 83 ELSE CASE WHEN (model_input."X_7" <= 8.500000) THEN CASE WHEN (model_input."X_9" <= 9.500000) THEN CASE WHEN (model_input."X_3" <= 4.500000) THEN CASE WHEN (model_input."X_9" <= 2.000000) THEN 95 ELSE 96 END ELSE 94 END ELSE 92 END ELSE CASE WHEN (model_input."X_6" <= 1.500000) THEN CASE WHEN (model_input."X_9" <= 8.500000) THEN 89 ELSE 90 END ELSE 88 END END END END END ELSE CASE WHEN (model_input."X_2" <= 8.500000) THEN CASE WHEN (model_input."X_9" <= 7.500000) THEN CASE WHEN (model_input."X_3" <= 7.500000) THEN CASE WHEN (model_input."X_0" <= 4.500000) THEN CASE WHEN (model_input."X_6" <= 6.500000) THEN CASE WHEN (model_input."X_4" <= 2.500000) THEN 119 ELSE CASE WHEN (model_input."X_5" <= 3.000000) THEN CASE WHEN (model_input."X_0" <= 1.500000) THEN CASE WHEN (model_input."X_2" <= 7.500000) THEN 125 ELSE 126 END ELSE 124 END ELSE 122 END END ELSE 118 END ELSE 116 END ELSE CASE WHEN (model_input."X_1" <= 5.000000) THEN CASE WHEN (model_input."X_0" <= 4.500000) THEN CASE WHEN (model_input."X_7" <= 3.500000) THEN 57 ELSE 58 END ELSE 20 END ELSE CASE WHEN (model_input."X_2" <= 6.500000) THEN 21 ELSE CASE WHEN (model_input."X_8" <= 7.500000) THEN CASE WHEN (model_input."X_2" <= 7.500000) THEN 25 ELSE 26 END ELSE CASE WHEN (model_input."X_6" <= 2.000000) THEN 27 ELSE 28 END END END END END ELSE CASE WHEN (model_input."X_5" <= 9.500000) THEN 11 ELSE 12 END END ELSE CASE WHEN (model_input."X_5" <= 6.500000) THEN 7 ELSE CASE WHEN (model_input."X_6" <= 0.500000) THEN 29 ELSE 30 END END END END END AS node_id
